"use strict";(self.webpackChunkexonumia_cc=self.webpackChunkexonumia_cc||[]).push([[69837],{96103:(a,o,i)=>{i.r(o),i.d(o,{data:()=>d});const d={key:"v-54c7ca72",path:"/som/so/museum/bitcoin-v0.1-released/",title:"Bitcoin v0.1 ayaa la sii daayay",lang:"so",frontmatter:{translators:[{name:"Shaadiya Maxamed Cabdi",href:"https://instagram.com/shadia_iimay_/"}],supporters:[{name:"BitMEX",href:"https://blog.bitmex.com/bitmex-grant-translation-of-bitcoin-content-into-african-languages/"}]},excerpt:"",headers:[],filePathRelative:"som/so/museum/bitcoin-v0.1-released/README.md",git:{updatedTime:1763586228e3}}},68777:(a,o,i)=>{i.r(o),i.d(o,{default:()=>h});var d=i(66252);const n=(0,d._)("h1",{id:"bitcoin-v0-1-ayaa-la-sii-daayay",tabindex:"-1"},[(0,d._)("a",{class:"header-anchor",href:"#bitcoin-v0-1-ayaa-la-sii-daayay","aria-hidden":"true"},"#"),(0,d.Uk)(" Bitcoin v0.1 ayaa la sii daayay")],-1),e=(0,d.Uk)("Waxaa qoray Satoshi Nakamoto "),s={href:"https://web.archive.org/web/20190604064539/https://www.mail-archive.com/cryptography@metzdowd.com/msg10142.html",target:"_blank",rel:"noopener noreferrer"},r=(0,d.Uk)("2009/01/09"),t=(0,d.uE)("<p>Announcing the first release of Bitcoin, a new electronic cash Ku dhawaaqida sii deynta ugu horeysa ee Bitcoin, lacag caddaan ah oo elektaroonik ah oo cusub nidaamka adeegsada isku-xidhka isku-filka ah si looga hortago kharashka laba-jibbaaran. Si buuxda ayaa loo daadajiyay iyada oo aan lahayn server ama maamul dhexe.</p><p>Ka eeg bitcoin.org shaashadaha.</p><p>Soo dejiso linkigan: http://downloads.sourceforge.net/bitcoin/bitcoin-0.1.0.rar</p><p>Daaqadaha hadda. Koodhka isha furan ee C++ ayaa ku jira. Ka soo saar faylalka buug-tusaha</p><ul><li>Orod BITCOIN.EXE</li><li>Waxay si toos ah ugu xidhmaysaa noodhka kale</li></ul><p>Haddii aad sii wadi karto noodhka aqbala xidhiidhada soo socda, Runtii aad ayaad u caawin doontaa shabakada Dekedda 8333 adiga Firewall wuxuu u baahan yahay inuu furnaado si loo helo isku xirka soo socda.</p><p>Software-ku wali waa alfa iyo tijaabo. Ma jiro dammaanad Xaaladda nidaamka ma aha in mar uun dib loo bilaabo haddii ay dhacdo lagama maarmaan noqoto, in kasta oo aan sameeyay wax kasta oo aan ku dhisi karo kordhinta iyo versioning.</p><p>Waxaad heli kartaa qadaadiic adiga oo hela qof kuu soo dira, ama shid Options-&gt;Samee qadaadiic si aad u socodsiiso noode una abuurto blocks. waan sameeyay Cadaadiska shaqada si fudud oo qosol leh ayaa fudud in lagu bilaabo, sidaas darteed In yar oo bilawga ah PC-ga caadiga ah ayaa awood u yeelan doona ku soo saar qadaadiic dhowr saacadood gudahood. Aad bay u adkaan doontaa marka Tartanku wuxuu hagaajinta tooska ah ka dhigayaa inuu kor u qaado dhibaatada. qadaadiicda la soo saaray waa inay sugaan 120 baloog si ay u bislaadaan ka hor inta aanay noqon kharash gareeyay.</p><p>Waxaa jira laba qaab oo lacag lagu diro. Haddii qaataha online yahay, adiga waxay geli karaan ciwaanka IP-ga wayna ku xidhmi doontaa, hel dadwayne cusub fur oo u dir macaamilka faallooyinka. Haddii qaataha yahay ma online, waxaa suurtogal ah in loo diro ciwaankooda Bitcoin, kaas oo waa xashiish furahooda guud oo ay ku siinayaan. Way heli doonaan macaamilka marka xigta ay ku xidhmaan oo ay helaan block waa in. Habkani waxa uu leeyahay faa&#39;iido darro in aan faallada macluumaadka waa la soo diraa, oo xoogaa sir ah ayaa lumi kara haddii ciwaanka la isticmaalo dhowr jeer, laakiin waa beddel faa&#39;iido leh haddii labada isticmaale aysan awoodin isla mar ahaantaana online ama qaataha ma heli karo soo galo isku xirka ah. Wadarta wareegga waxay noqon doontaa 21,000,000 oo qadaadiic ah. Waa la qaybin doonaa si ay u xidhmaan noodhka marka ay sameeyaan blocks, iyadoo qadarka la jaray kala badh 4tii sanaba mar.</p><p>4-ta sano ee ugu horreeya: 10,500,000 qadaadiic<br> soo socda 4 sano: 5,250,000 qadaadiic<br> soo socda 4 sano: 2,625,000 qadaadiic<br> soo socda 4 sano: 1.312.500 qadaadiic</p><p>iwm... Marka taasi dhamaato, nidaamku wuxuu taageeri karaa khidmadaha wax kala iibsiga haddii loo baahan yahay. Waxay ku salaysan tahay tartanka suuqa furan, wuuna jiri doonaa waxay u badan tahay inay had iyo jeer noqdaan unugyo diyaar u ah inay wax kala iibsadaan lacag la&#39;aan.</p><p>Satoshi Nakamoto</p><hr><p>The Cryptography Mailing List Unsubscribe by sending &quot;unsubscribe cryptography&quot; to majord...@metzdowd.com</p>",14),u={},h=(0,i(83744).Z)(u,[["render",function(a,o){const i=(0,d.up)("OutboundLink"),u=(0,d.up)("LanguageDropdown");return(0,d.wg)(),(0,d.iD)(d.HY,null,[n,(0,d._)("p",null,[e,(0,d._)("a",s,[r,(0,d.Wm)(i)])]),(0,d.Wm)(u),t],64)}]])},83744:(a,o)=>{o.Z=(a,o)=>{const i=a.__vccOpts||a;for(const[a,d]of o)i[a]=d;return i}}}]);